Nature's Miracle Orphans

Nature Documentary hosted by Ellie Harrison and Max Hug Williams, published by BBC in 2014 - English narration


Information
------------------------------

Nature's Miracle Orphans
The first months of an animal's life are crucial - if they lose their mothers, they'll need help. Meet the wild orphans getting a second chance, and those devoted to saving them.


1)  1 
In Australia, Ellie meets Danny the baby koala in need of round the clock care, and Neil, a tiny orphaned wallaby, whose carer Stella believes Neil may die from stress if she can't find him a companion. In Costa Rica, Max is with Newbie, a baby three-toed sloth battling with pneumonia. Wildlife manager Sam is doing all she can to help Newbie beat the infection and get back to the rainforest.

2)  Part 2 
Ellie Harrison and Max Hug Williams continue to follow the stories of orphaned baby animals on opposite sides of the world. In Australia, Ellie meets Stacy, the baby wombat with a big personality. Carer Sue looks after her in the family home, but stubborn Stacey can be quite a handful. And in a wildlife rescue centre in Costa Rica, Newbie the baby three-toed sloth continues the battle with pneumonia and her rehabilitation, and Al, a laid-back anteater, needs to learn the knack of dealing with aggressive jungle ants. All of them are on a challenging journey back to the wild, where they belong.

